import React, { useState } from 'react';
import styled from 'styled-components/native';
import { StyleSheet, Image, TouchableOpacity, TextInput, View } from 'react-native';
import logo from '../assets/background.png';

import { FontAwesome } from '@expo/vector-icons';

import { EvilIcons } from '@expo/vector-icons';

import { MaterialCommunityIcons } from '@expo/vector-icons';

const HomePage = ({ navigation }) => {
    const [food, setFood] = useState([
        // { text: 'Broccoli', key: '1' },
        // { text: 'Morot', key: '2' },
        // { text: 'Ärtor', key: '3' },

    ])

    const submitHandler = (text) => {

        if (text.length > 2) {
            setFood((prevFood) => {
                return [
                    { text: text, key: Math.random().toString() },
                    ...prevFood
                ];
            })
        } else {
            Alert.alert('Oops!', 'Mer än 2 bokstäver behövs', [
                { text: 'Ok', onPress: () => console.log('alert closed') }
            ]);
        }
    }

    return (
        <Container>

            <BackgroundImage>
                <Image source={logo} style={styles.image} />
            </BackgroundImage>
            <Icon>
                <TouchableOpacity onPress={() => navigation.navigate('LoginForm')}>
                    <EvilIcons name="arrow-right" size={90} color="#ABA97B" />
                </TouchableOpacity>
            </Icon>
            <Buttons>

                <TouchableOpacity onPress={() => navigation.navigate('LoginForm')}>
                    <View style={styles.button}>

                        <ButtonText>Logga in</ButtonText>

                    </View>
                </TouchableOpacity>

                <TouchableOpacity onPress={() => navigation.navigate('LoginForm')}>
                    <View style={styles.button}>

                        <ButtonText>Bli medlem</ButtonText>

                    </View>
                </TouchableOpacity>

            </Buttons>
        </Container >
    )

}

const styles = StyleSheet.create({
    image: {
        marginTop: 30,
        width: 350,
        height: 550
    },
    input: {
        borderWidth: 2,
        borderColor: '#ABA97B',
        borderRadius: 10,
        padding: 5,
        backgroundColor: 'white',
        height: 50,
        width: 200,
        shadowColor: '#202020',
        shadowOffset: { width: 0, height: 5 },
        shadowRadius: 5,
        fontSize: 20,
        color: '#ABA97B',
    },
    button: {
        width: 120,
        height: 40,
        alignItems: 'center',
        justifyContent: 'center',
        borderRadius: 50,
        borderColor: 'black',
        borderWidth:1,
        marginTop: 5,
        margin: 5,
      }
})

const Container = styled.View`
flex:1;
background-color: white;
width: 100%;
height:1000px;
color: white;
flex-direction: column;
justify-content:flex-start;
border: solid 1px black;
`
const BackgroundImage = styled.View`

`
const Icon = styled.View`
align-items:center;
`
const Buttons = styled.View`
flex-direction: row;
margin-top: 20px;
border: solid 1px black;
justify-content: center;
`

const ButtonText = styled.Text`
color: black;
font-size: 20px;
`



export default HomePage;
